import React, { useState } from "react"
import { Navigate } from "react-router-dom"

function Dashboard({ authorized }) {
    if (!authorized === false){
        return <Navigate to="/login" />
    } 
    else return(
            <div>Hello World</div>
    )
}



export default Dashboard;
